import 'react-multi-carousel/lib/styles.css';
import colorSharp from "../assets/img/color-sharp.png"
import { Container,Row ,Col } from "react-bootstrap";
import Skilldata from './Skilldata';

export const Skills = () => {
  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };

  return (
    <section className="skill" id="skills">
        <div className="container">
            <div className="row">
                <div className="col-12">
                    <div className="skill-bx wow zoomIn">
                        <h2>Skills</h2>
                        <h4>Programming Languages</h4>
                        <Row className="justify-content-center">
                            <Col md={3}>
                              <Skilldata imglink="https://cdn-icons-png.flaticon.com/512/6132/6132222.png" skillname="C/C++"/>
                            </Col>
                            <Col md={3}>
                                <Skilldata imglink="https://cdn-icons-png.flaticon.com/512/919/919852.png" skillname="Python"/>
                            </Col>
                            <Col md={3}>
                                <div className="item">
                                <img src="https://cdn-icons-png.flaticon.com/512/919/919852.png"
                                   alt="Image" 
                                   style={{ height: 100, width:100 }}
                                   />
                                  <h5>Java Script</h5>
                                </div>
                                <Skilldata imglink="https://cdn-icons-png.flaticon.com/512/919/919852.png" skillname="Java Script"/>
                            </Col>
                          </Row>
                    </div>
                </div>
            </div>
        </div>
        <img className="background-image-left" src={colorSharp} alt="Image" />
    </section>
  )
}
